import React, {Component } from 'react';
import logo from './logo.svg';
import './App.css'

class App extends Component {
  constructor(){
    super();
    this.state={
      string: 'Hello Suxin'

    }
  }
  render(){
    return (
    <div className='App'>
      <header className='App-header'>
        <img src={logo} className='App-logo' alt='logo'/>
        <p> {this.state.string} </p>
        <button onclick={()=>this.setState({string: 'hello heng'})}> change text</button>
        <a
          className='App-link'
          href='https:/reactjs.org'
          target='_blank'
          rel='noopener noreferrer'
          >
            Learn React
          </a>
        </header> 
    </div>
    )
  }
}

export default App;
